  true,\n\t\"url\": null,\n\t\"notes\": \"The aim of this project is the development
  a large data warehousing and analysis tool for air traffic management (ATM) research
  that can be accessed by users through intuitive web-based User Interface (UI). DSAT
  is designed to support requirements of a variety of ATM users, from data handlers
  interested in maintaining data quality to researchers looking for patterns in acquired
  data to analysts who need to compute basic metrics on a particular subset of data
  to managers who need to visualize and report results from a particular analysis.
  DSAT is a multi-level, multi-objective tool for big data analysis that extracts
  ATM data from a variety of ATM data stores and prepares it for holistic analysis
  within an actionable timeline. At this time no turnkey software exists that supports
  all levels of data handling from storage to reporting for ATM research DSAT serves
  the purpose of a variety of users through a set of tools customized to handle different
  types of ATM analysis for different types of users. In particular, DSAT is a (i)
  data storage tool, (ii) data analysis tool, and (iii) visualization and reporting
  tool all wrapped into one.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
